import React from 'react'
import classNames from 'classnames'

const EmptyState = props => {
  const { icon, mainText, secondText, style } = props
  return (
    <div
      className={classNames('columns is-centered is-marginless', {
        'has-border-bottom': style === 'accounting-style'
      })}
    >
      <div className='column is-6'>
        <div
          className={classNames(`intermediate-step`, {
            secundary: style === 'secundary',
            'accounting-style': style === 'accounting-style'
          })}
        >
          <div className='intermediate-step__container'>
            <div className='intermediate-step__container__icon'>
              <i className={`mdi mdi-${icon}`} />
            </div>

            <p className='intermediate-step__container__main-text'>
              {mainText}
            </p>
            {secondText && (
              <p className='intermediate-step__container__second-text'>
                {secondText}
              </p>
            )}
          </div>
        </div>
      </div>
    </div>
  )
}

export default EmptyState
